import React from 'react'
import styles from "./ToDoList.module.css"
import ListItem from "./ListItem";

const List = ({tasks, }) => {
  return (
    <ul className={styles.list}>
        {
            tasks.map((item) => {
                return (
                    <ListItem key={item.id} tasks={tasks} item={item}/>
                )
            })
        }
    </ul>
  )
}

export default List
